options('download.file.method.GEOquery' = 'curl')

# Set a longer timeout to avoid connection timeouts
options(timeout = 600)  

# Create directory for the downloaded data
baseDir <- "./myData"
if (!dir.exists(baseDir)) {
  dir.create(baseDir)
}

# Function to download supplemental files
download_supplemental_files <- function(gse, baseDir) {
  tryCatch({
    # Print message with which GSE is being processed
    cat("Attempting to download for GSE:", gse, "\n")
    
    # Download the supplemental files
    getGEOSuppFiles(gse, makeDirectory = TRUE, baseDir = baseDir,
                    fetch_files = TRUE, filter_regex = NULL)
    
    cat("Successfully downloaded files for GSE:", gse, "\n")
  }, error = function(e) {
    # Error handling and printing the error message
    cat("Error with GSE:", gse, "\n", e$message, "\n")
  })
}

# Loop through the GSE IDs and try to download their supplemental files
for (gse in gse_list) {
  download_supplemental_files(gse, baseDir)
}
